import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';


const el = React.createElement(
  "h1",
  null,
  "Hello, world!"
)

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(el);
